import {Route, BrowserRouter as Router, Routes} from 'react-router-dom';
import Facility from './components/facilityComponents/facility';
function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/facility"  element={<facility/>}/>

        </Routes>

      </Router>
      
    </div>
  );
}

export default App;
